@coffeekraken.s-file.config.sFile.classe.description:
Map some SFile classes path using minimatch patterns like so:
{
'.scss,*.sass': `${__packageRootDir(__dirname)}/src/node/scss/SScssFile`
}

example.code:
import SFile from '@coffeekraken/s-file';
const file = new SFile('something/cool/sugar.json');
file.extension; // => json
file.exists; // => true
